  false,\n\t\"url\": null,\n\t\"notes\": \"Zooplankton, chemical and other data were
  collected from bottle and net cast from BOCAS DE CENIZA from the SE Pacific (limit-140).
  Data were collected by the Inter-American Tropical Tuna Commission from 20 August
  1965 to 30 August 1965. Zooplankton data include displaced volume and taxonomic
  name. Chemical data include water temperature, salinity, oxygen, phosphate, silicate,
  nitrite, chlorophyll a, phaeopigments, and nitrate. Other data include air temperature,
  relative humidity, barometric pressure, cloud amount, cloud type, wind speed, wind
  direction, and water transparency. Data are in a comma separated value (.csv) format.
  Additional funding for digitizing historic data were provided by the Global Ocean
  Data Archaeology and Rescue (GODAR) project.\",\n\t\"owner_org\": \"9cda5205-d632-4814-96e7-a4ab5e0dce85\",\n\t\"extras\":
